import React, { useEffect, useState } from "react";
import Navbar from "../components/Navbar.j";
import Footer from "../components/Footer";
import axios from "axios";

export default function Orders() {
  const [orderData, setOrderData] = useState([]);  // Initialize as an array

  const fetchMyOrder = async () => {
    try {
      const res = await axios.post("http://localhost:5000/api/myOrderData", {
        email: localStorage.getItem("userEmail"),
      });
      if (res && res.status === 200) {
        // console.log(res.data.orderData);
        setOrderData(res.data.orderData);
      }
    } catch (error) {
      alert("Server Error.");
    }
  };

  useEffect(() => {
    fetchMyOrder();
    console.log(orderData)
  }, []);
  return (
    <>
      <div>
        <Navbar />
      </div>

      <div className="container">
        <div className="row">
          {(orderData && orderData.length > 0) ? (  // Conditional rendering based on correct state
            orderData
              .slice(0)
              .reverse()
              .map((orderGroup) => {
                return orderGroup.order_data.map((item, index) => {
                  return item.map((arrayData, innerIndex) => {
                    return (
                      <div key={`${index}-${innerIndex}`}>
                        {arrayData.Order_date ? (
                          <div className="m-auto mt-5">
                            <strong>{arrayData.Order_date}</strong>
                            <hr />
                          </div>
                        ) : (
                          <div className="col-12 col-md-6 col-lg-3">
                            <div
                              className="card mt-3"
                              style={{
                                width: "16rem",
                                maxHeight: "360px",
                              }}
                            >
                              <img
                                src={arrayData.img}
                                className="card-img-top"
                                alt={arrayData.name}
                                style={{
                                  height: "120px",
                                  objectFit: "fill",
                                }}
                              />
                              <div className="card-body">
                                <h5 className="card-title">
                                  {arrayData.name}
                                </h5>
                                <div
                                  className="container w-100 p-0"
                                  style={{ height: "38px" }}
                                >
                                  <span className="m-1">
                                    {arrayData.qty}
                                  </span>
                                  <span className="m-1">
                                    {arrayData.size}
                                  </span>
                                  <div className=" d-inline ms-2 h-100 w-20 fs-5">
                                    â‚¹{arrayData.price}/-
                                  </div>
                                </div>
                              </div>
                            </div>
                          </div>
                        )}
                      </div>
                    );
                  });
                });
              })
          ) : (
            <div>Order Something...</div>
          )}
        </div>
      </div>

      <div>
        <Footer />
      </div>
    </>
  );
}
